INSERT INTO wp_posts VALUES("29","1","2016-02-25 01:17:13","2016-02-25 00:17:13","Trójmiejski turniej robotów jest imprezą organizowaną od wielu wieków. W XV wieku przedstawiciele władz Imperium Rumskiego, która była wtedy bezkonkurencyjnym liderem w dziedzinie robotyki zaproponowała pobliskiej wiosce o nazwie Trójmiasto współpracę w zorganizowaniu turnieju, w którym rycerze z całego Imperium i okolic mogli ze sobą rywalizować w różnych konkurencjach związanych z robotyką zdobywając sławę, nagrody i nierzadko też podbijając serca wielu księżniczek. Później Imperium Rumskie skupiło się na pracy w innych aspektach robotyki pozostawiając organizację corocznego turnieju Trójmiastu, które bardzo dobrze wywiązuję się ze swego zadania. W tym roku również zapraszamy wszystkich chętnych rycerzy do wzięcia udziału w zawodach!","O turnieju","","publish","closed","closed","","o_turnieju","","","2016-03-03 17:43:38","2016-03-03 16:43:38","","0","http://localhost/TTR_M/?page_id=29","0","page","","0");
