INSERT INTO wp_posts VALUES("137","1","2016-03-03 17:18:10","2016-03-03 16:18:10","<h1>O turnieju -&gt; Konkurencje</h1>\r\n<b>W turnieju zawodnicy zmagać się będą w następujących konkurencjach:</b>\r\n\r\n<strong>Linefollower</strong> - robot musi przejechać trasę zaznaczoną czarną linią w jak najkrótszym czasie\r\n<div>&nbsp;</div>\r\n<strong>Micromouse</strong> - robot musi przejechać labirynt w jak najkrótszym czasie\r\n<div>&nbsp;</div>\r\n<strong>Sumo</strong> - dwa roboty walczą ze sobą, walka trwa dopóki jeden z robotów nie wypadnie z toru\r\n<strong>Freestyle</strong> - tu dowolność\r\n<strong>Niespodzianka</strong> - piąta kategoria","Konkurencje","","inherit","closed","closed","","38-revision-v1","","","2016-03-03 17:18:10","2016-03-03 16:18:10","","38","http://localhost/TTR_M/38-revision-v1/","0","revision","","0");
