INSERT INTO wp_posts VALUES("182","1","2016-03-04 12:08:47","2016-03-04 11:08:47","To jest przykładowa strona. Różni się ona od postu na blogu, ponieważ pozostanie ona ciągle w jednym miejscu i pokaże się w panelu nawigacyjnym na twojej stronie (w przypadku większości szablonów). Większość osób zaczyna od strony \'O mnie\' lub \'O nas\', która przedstawia ich potencjalnym odwiedzającym stronę. Może to być coś takiego:\n\n<blockquote>Cześć! Jestem kurierem na rowerze za dnia, nocą aktorem amatorem, a to jest mój blog. Mieszkam w Gdańsku, mam wspaniałego psa o imieniu Azor i uwielbiam pi&#241;a coladę. (Oraz to, kiedy łapie mnie deszcz.)</blockquote>\n\n...lub coś bardziej jak to:\n\n<blockquote>Firma XYZ została założona w 1971 roku i od tamtej pory wytwarza najlepszej jakości wijaster na rynku. Zlokalizowana w Pacanowie zatrudnia ponad 2000 osób i jest powodem samego dobrodziejstwa dla lokalnej społeczności.</blockquote>\n\nJako nowy użytkowni WordPressa, powinieneś odwiedzić <a href=\"http://localhost/TTR_M/wp-admin/\">swój panel administracyjny</a>, aby skasować tę stronę i stworzyć nowe, dostosowane do Twoich potrzeb strony. Miłej zabawy!","Przykładowa strona","","inherit","closed","closed","","2-revision-v1","","","2016-03-04 12:08:47","2016-03-04 11:08:47","","2","http://localhost/TTR_M/2-revision-v1/","0","revision","","0");
